import React from 'react';
import PropTypes from 'prop-types';
import logo from '../../assets/images/logo.svg';
import Menu from '../shared/Menu/Menu';

const Header = props => {
    return (
        <div className='bg-white w-full fixed flex flex-row-reverse pl-72 pr-10 py-8'>
            <div className='flex flex-col items-end relative'>
                <a href='#' className='block relative'>
                    <img src={logo} className='mx-auto object-cover rounded-full w-12' alt='profile' />
                </a>
                <ul className='bg-white w-48 p-3 mt-5 absolute top-12 shadow-md rounded-xl'>
                    <Menu.Item className={'mt-0 mb-2 pl-0'}>Settings</Menu.Item>
                    <Menu.Item className={'mt-0 pl-0'}>Log out</Menu.Item>
                </ul>
            </div>
        </div>
    );
};

Header.propTypes = {};

export default Header;
